DROP TABLE Premium_data CASCADE CONSTRAINTS;


CREATE TABLE Premium_data(
	id int,
	months_as_customer NUMBER,
	policy_deductable NUMBER,
	policy_annual_premium NUMBER,
	insured_education_level VARCHAR2(50),
	insured_occupation VARCHAR2(50),
	capital_gains NUMBER,
	captial_loss NUMBER,
	incident_severity VARCHAR2(50),
	authorities_contacted VARCHAR2(50),
	number_of_vehicles_involved int,
	property_damage VARCHAR2(50),
	bodily_injuries NUMBER,
	witnesses NUMBER,
	police_report_available VARCHAR2(50),
	total_claim_amount NUMBER,
	injury_claim NUMBER,
	property_claim NUMBER,
	vehicle_claim NUMBER,
	fraud_reported VARCHAR2(50),
	PRIMARY KEY (id)
);

commit;